import { Dependency } from '@/core/dependency';
import Component from 'vue-class-component';
import usersManager from "@/post-details-managment/post-details.service";

@Component
export default class AccountDetailsComponent extends Dependency {
  constructor() {
    super(['usersManager']);
  }

  data() {
      return {
          usersDataAdditional: null
      }
  }

  mounted() {
    this.usersManager.getInitialData().subscribe(r => {
       this.$data.usersDataAdditional = r;
    });
  }
}
